                {
                    Id = patientId,
                    FullName = new Fullname("Maria", "Gonzalez"),
                    DateOfBirth = new DateTime(1990, 5, 12),
                    Jmbg = new Jmbg("1709002173401"),
                    Gender = "Female",
                    Contact = new ContactInformation("+987654321", "ikanoviczeljko362@gmail.com", "123 Main Street, City"),
                    BloodType = new BloodType("A+"),
                    EmergencyContact = new EmergencyContact("James Gonzalez", "+987654322"),
                    DoctorId = doctorId,
                    CreatedAt = DateTime.UtcNow
                };

               
                patient.AddAllergy("Pollen", Severity.Mild);
                patient.AddAllergy("Peanuts", Severity.Moderate, "Carries epipen");

             
                patient.AddChronicDisease("Asthma", Severity.Moderate);
                patient.AddChronicDisease("Hypertension", Severity.Mild, "Monitored with diet and exercise");


