                    "Asthma attack"
                ));

             
                patient.AddScanImage("MRI", "", new DateTime(2022, 5, 10));
                patient.AddScanImage("MRI", "", new DateTime(2023, 1, 12));

                await context.Patients.AddAsync(patient);
                await context.SaveChangesAsync();
            }
        }
    }
}
